#include "OOLC.h"

namespace world_NPC {
    class gou :public NPC {
    public:
        int age;
        
        gou(const point& position) :NPC(1, position), age(0) { name = "狗"; }
        
        virtual void playerDo(player* p, Map* m) {
            say("狗：汪");
            sayyes();
            sayclear();
        }
        virtual void selfDo(player* p, Map* m) {
            age++, age %= 80;
            if (age < 20) {
                (*m)[position + point(0, 1)].name = "汪";
                (*m)[position + point(0, 1)].visible = 1;
                (*m)[position + point(0, 1)].passable = 0;
            }
            else{
                (*m)[position + point(0, 1)].visible = 0;
                (*m)[position + point(0, 1)].passable = 1;
            }
        }
        virtual ~gou() {};
    };
    class yu :public NPC {
    public:
        point begin;
        yu(const point& position) :NPC(1, { position }, {1,0}), begin(position) { name = "鱼"; }
        virtual void playerDo(player* p, Map* m) {
            say("咸鱼：等我翻个身……");
            sayyes();
            sayclear();
        }
        virtual void selfDo(player*p,Map*m) {
            if (position == begin - point(1, 0)) {
                velocity = point(1, 0);
            }
            else if (position == begin + point(1, 0)) {
                velocity = point(-1, 0);
            }
        }
        virtual ~yu() {}
    };
    class fa : public NPC {
    public:
        int age;
        const char* s;
        point begin;
        point end;
        fa(const char* name, const point& pos, const char* s, int age = -1) :NPC(1, pos, { 0,1 }), begin(pos), end(pos + point(0, 4)), age(age), s(s) { this->name = name; ifMove = 1; }
        virtual void playerDo(player* p, Map* m) {
            using namespace std;
            say(s);
            sayyes();
            sayclear();
        }
        virtual void selfDo(player* p, Map* m) {
            age++, age %= 30;
            if (age <= 2&& age%2==0) {
                ifMove = 1;
            }
            else {
                ifMove = 0;
            }
            if (position == begin) {
                velocity = point(0, 1);
            }
            else if (position == end) {
                velocity = point(0, -1);
            }
        }
        virtual ~fa() {}
    };
    class feng :public NPC {
    public:
        int age = 0;
        point begin;

        feng(const point& position) :NPC(0, position,{0,1},0), begin(position) { name = "风"; }
        virtual void selfDo(player* p, Map* m) {
            age++, age %= 40;
            if (age < 8) {
                visible = 1;
                crazyMove = 1;
            }
            else if (age == 39) {
                visible = 1;
            }
            else {
                crazyMove = 0;
                visible = 0;
                position = begin;
            }
        }
        virtual ~feng() {}
    };
    class ge : public NPC {
    public:
        int age;
        point begin;
        point end;
        ge(const char* name, const point& pos, int age = 0) :NPC(1, pos, { 1,0 }), begin(pos), end(pos + point(10, 0)), age(age){ this->name = name; ifMove = 1; }
        virtual void playerDo(player* p, Map* m) {
            using namespace std;
            say("葛：八百标兵奔北坡，炮兵并排北边跑。");
            say("    炮兵怕把标兵碰，标兵怕把炮兵炮。", 2);
            sayyes();
            sayclear();
        }
        virtual void selfDo(player* p, Map* m) {
            age++, age %= 17;
            if (age == 0) {
                ifMove = 1;
            }
            else {
                ifMove = 0;
            }
            if (position == begin) {
                velocity = point(1, 0);
            }
            else if (position == end) {
                velocity = point(-1, 0);
            }
        }
        virtual ~ge() {}
    };
    class runCircle :public NPC{
    public:
        int age = 0;
        int slow;
        int x1,x2,y1,y2;
        const char* s;

        runCircle(const char* name, const point& pos, const point& big, const char* s, int slow = 1) :NPC(1, pos), s(s), x1(pos.x), x2(pos.x + big.x - 1), y1(pos.y), y2(pos.y + big.y - 1), slow(slow) { this->name = name; }
        virtual void playerDo(player* p, Map* m) {
            say(s);
            sayyes();
            sayclear();
        }
        virtual void selfDo(player*p,Map*m) {
            age++, age %= slow;
            if (age == 0) {
                ifMove = 1;
                if (position == point(x1, y1)) {
                    velocity = { 1,0 };
                }
                else if (position == point(x2, y1)) {
                    velocity = { 0,1 };
                }
                else if (position == point(x2, y2)) {
                    velocity = { -1,0 };
                }
                else if (position == point(x1, y2)) {
                    velocity = { 0 ,-1 };
                }
            }
            else {
                ifMove = 0;
            }
        }
        virtual ~runCircle() {}
    };
    class zhuo :public NPC {
    public:
        int age = 0;
        zhuo(const point& pos) :NPC(1, pos) { name = "啄"; }
        virtual void selfDo(player* p, Map* m) {
            if (age == 0) {
                ifMove = 1;
                velocity = { -1,0 };
            }else if (age == 1) {
                velocity = { 1,0 };
            }
            else {
                velocity = {0,0};
            }
            age++, age %= 30;
        }
        virtual ~zhuo() {}
    };
}

static void sceneReady(scene& scn, player& p);
static void sceneEnd(scene& scn);
void world(player& p) {
	scene world;
	sceneReady(world, p);
	world.gameStart();
    //动画
    try {
        while (1) {
            world.printMap();
 
            world.playerDo();//其他按键功能
            world.NPCDo();
            world.playerMove();
            world.NPCMove();
            world.esc();

            Sleep(50);
        }
    }
    catch (int) {//换地图，地图文件存档

    }
    catch (const char*) {//退出
        p.exit = 1;
    }
    sceneEnd(world);
}

